import clip from '/dsp/softclip/index.js'
import arp from '/dsp/arp.js'
import envelope from '/dsp/envelope/index.js'
import Reverb from '/dsp/freeverb/index.js'

export const bars = 4

export default async (context) => {
  const { beat } = context.lengths
  const reverb = await Reverb(context)

  return mix => mix(
    t => kick(t) * ((t%8) < 7),
    t => {
      const kickSlice = t.output[0].slice(0,beat)
      t.output[0].set(kickSlice.slice(0,-(beat*(1/2))), beat*(7+1/2))
      t.output[0].set(reverse(t).slice(-beat+10), t.output[0].length - beat)
      return t.output[0]
    },
    t => reverb(t, { feedback: .8, damp: .2, wet: .33 })*3
  )
}

const reverse = t => t.output[0].slice().reverse()

export const kick = t => {
  var kick =
    + sin(t, 19.5) * arp(t, 1/4, 37, 31, 13)
    + (arp(t, 1/4, 38.5, 48, 40)
    + arp(t, 1/4, 35, 49, 40))
    * envelope(t, 1/4, 42, 42, 20) * 1
  kick = clip(kick, 1)
  return kick * .8
}
