{"id":"4e4mz","title":"untitled-5c0721","value":"import clip from '/dsp/softclip/index.js'
import { sin } from '/dsp/osc/index.js'
import arp from '/dsp/arp.js'
import envelope from '/dsp/envelope/index.js'
import Wavetable from '/dsp/wavetable-osc/index.js'
import Reverb from '/dsp/freeverb/index.js'
import stereoify from '/dsp/stereoify.js'

export const channels = 2

export default async (context) => {
  const ch = await Hihat(context, 1/16, 350)
  const oh = await Hihat(context, 1/4, 124)
  const reverb = await Reverb(context)

  return mix => mix(
    t =>
      + ch(t)*(sin(t,6)*1)*2.8
      + oh(t+1/2)*3.7,
    t => reverb(t, { feedback: .2, damp: .2, wet: .27 }),
    t => stereoify(t)
  )
}

export const Hihat = async (context, rate = 1/4, decay = 70) => {
  var hihat = 0
  var hihat_osc = Wavetable(context, 'noise', 30100, true)
  var hihat_delay = Array(100).fill(0)

  return t => {
    hihat = hihat_osc(1.2)
    hihat *= arp(t, rate, 220, 60, decay)
    hihat = clip(hihat, .71)
    hihat *= arp(t, 1/16, 12000, 12.6, 60)
    hihat_delay.push(-hihat)
    hihat_delay.shift()
    return (
      + hihat
      + hihat_delay[98] * .8
      + hihat_delay[69] * .7
      // - hihat_delay[25] * .5
      - hihat_delay[72] * .8
    ) * .3
  }
}
