import stereoify from '/dsp/stereoify.js'

const Melody = [7,4,8].map(n => note(n+15))

export const channels = 2
export const bars = 4

export default async (context) => {
  const filter = await Filter(context)
  let n = 0
  return mix => mix(
    t => {
      n = slide(t*4, 2, 1, Melody)
      return 0
        + saw(t, n) * .13
        + sqr(t, n*1.26) * .07
    },
    t => filter(t, lowpass(t, { cut: 400 + (340 * sin(t, 1/4)), res: 7.99 })),
    t => filter(t, highpass(t, { cut: 260, res: .7 })),
    t => stereoify(t),
  )
}
